import {Row,Col} from 'react-bootstrap';
import Grade from "../../../backend/models/gradeModel.js";
import axios from 'axios';
import grades from '../../backend/data/grade.js';

const HomeScreen=()=>{
    /*const[grades,setGrades]=useState([]);

