        const fetchGrades=async()=>{
            const{data}=await axios.get('/api/grades');
            setGrades(data);
        };
        fetchGrades();
    },[])*/

    return(
        <>
        <h1>Grades</h1>
        <Row>
            {grades.map((grade)=>(
                <Col sm={12} md={6} lg={4} cl={3}>
                    <h3>{grade.grade}</h3>
                </Col>
            ))}
        </Row>
        </>
    )
}

export default HomeScreen;
